import React, { Component } from "react";
import {
    Container, Row, Col
} from 'react-bootstrap';

class Contact extends Component {
    render() {
        return (
            <div className="component_content contact">
                <Container>
                    <Row>
                        <Col xs={12} xl={6}>
                            <div class="media mb-5">
                                <img src="./img/finn.png" alt="Finn" width="150" class="img-fluid mr-4" />
                                <div class="media-body"><h4 class="text-blue mb-0">Finn Abramsson</h4>
                                    <h5 class="text-blue">Technical Manager</h5>
                                    <p class="mb-0">
                                        <i aria-hidden="true" class="fa fa-envelope-o mr-1"></i>
                                Finn Abramsson
                            </p>
                                    <p class="mb-0">
                                        <i aria-hidden="true" class="fa fa-phone mr-1"></i>
                                Technical  Manager
                            </p>
                                    <p class="mb-0"><i aria-hidden="true" class="fa fa-skype mr-2"></i>
                                finn.abramsson
                            </p>
                                </div></div>
                        </Col>
                        <Col xs={12} xl={6}>
                        </Col>
                    </Row>
                </Container>
            </div>
        );
    }
}

export default Contact;
